Misturador Agitador desenvolvido para mesclar os componentes contidos nos produtos líquidos tais como: pigmentos de micropigmentação, tatuagens, cola para extensão de cílios, etc.

A agitação elétrica é feita de maneira mais uniforme do que a manual, o que irá prolongar a durabilidade do produto. Esse maravilhoso acessório facilita o trabalho da profissional, conseguindo minimizar o tempo do procedimento, visto que na agitação manual levava-se em média 02 minutos, agora só precisará de 20 segundos com a agitação elétrica.
O agitador é ideal para as colas de extensão de cílios, pigmentos e outros líquidos que precisam ser agitados para se tornarem mais homogêneos.

Características
Prático de usar;
Movido a bateria (pilha não inclusa)
Multiúso: utilizável com tampas de vários formatos trocando as ponteiras inclusas no kit;
Botão liga e desliga;
Design ergonômico e elegante, agregando valor ao seu atendimento.

Vantagens do Misturador
Agita seu adesivo, pigmento em poucos segundos;
Melhora a eficácia e o aproveitamento do produto;
Reduz os riscos de entupir o bico da cola (agitando de forma manual o líquido é chacoalhado em vertical).

Instruções de Uso
1- Insira o eixo de conexão antes de usar;
2- Escolha a ponteira ideal para seu uso e posicione-a no eixo. Depois que o eixo é colocado no misturador não remova mais, pois somente a ponteira é trocada;
3- Insira o produto na ponteira;
4- Pressione o interruptor localizado no misturador, ele irá vibrar e agitar o produto;
5- Se achar que a agitação não foi suficiente, repita o processo.

Itens inclusos
01 misturador elétrico (pilha);
02 eixos para encaixe;
06 ponteiras de silicone;

Informações adicionais
Funciona com 2 pilha AAA (pilha não inclusa)
Valor unitário
Imagens meramente ilustrativas

OBS: O envio é feito de forma aleatória, não sendo possível a escolha da cor. Atenciosamente.

